import ExpandableMenu from '../expandableMenu';
import ExpandableSearch from '../expandableSearch';

import {
    container as style_container,
    table as style_table
} from './index.module.css';

const HeaderMenu = ({
    image,
    searchValue,
    onChageSearchText
}) => {
    return <div className={style_container}>
        <div className={style_table}>
            <img
                src={image.url}
                width={image.width}
                height={image.height ? image.height : "auto"}
            />
            <ExpandableMenu
                
            />
            <ExpandableSearch
                value={searchValue}
                onChange={onChageSearchText}
                placegolder="Enter movie name here"
            />
        </div>
    </div>
};
export default HeaderMenu;
